# -*- coding: utf-8 -*-def check_password(func):    def check(num):        password = input('Введите пароль: ')        if password.lower() != 'password123':            print('В доступе отказано')            return        func(num)    return check@check_passworddef fib(num):    val = [0, 1]    for i in range(2, num + 1):        val.append(val[i - 1] + val[i - 2])    print(val[-1])fib(int(input('Число фибоначчи: ')))